import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <>
            <div style={{ backgroundColor: "#7494EA", padding: "10px", height: "300px" }}>
                <ul>
                    <li>
                        <Link to="#">Dogs</Link>
                    </li>
                    <li>
                        <Link to="#">Cats</Link>
                    </li>
                    <li>
                        <Link to="#">Sheep</Link>
                    </li>
                    <li>
                        <Link to="#">Goats</Link>
                    </li>
                </ul>
            </div>
        </>
    );
};

export default Navbar;
